メーカー希望小売価格はメーカーカタログに基づいて掲載しています<BR><BR>
<table width="300" bgcolor="#cccccc" border="0" cellspacing="1" cellpadding="8">
    <tr>
      <td bgcolor="#f3f3f3"><font size="-1" color="#333333"><b>商品説明</b></font></td>
    </tr>
    <tr>
      <td bgcolor="#ffffff"><font size="-1" color="#333333">温かみを感じさせる木製カフェトレーです。木目を生かした素材で、温もりあふれるナチュラルな風合いです。両端がつりあがっているので、持ちやすく配膳しやすいのがポイントです。</font></td>
    </tr>
    <tr>
      <td bgcolor="#f3f3f3"><font size="-1" color="#333333"><b>商品詳細</b></font></td>
    </tr>
    <tr>
      <td bgcolor="#ffffff">
      <font size="-1" color="#333333">サイズ／44×31×高さ4.2cm<br>
      重さ／約445g（商品により誤差があります。）<br>
      素材／天然木<br>
      質感／マット<br>
      生産地／中国<br>
      <br>
取り寄せ可能<br>
      <br>
        ※サイズは全て外寸になります。<br>
        ※不明な点がございましたら、お気軽にお問い合わせ下さい。</font></td>
    </tr>
    <tr>
      <td bgcolor="#f3f3f3"><font size="-1" color="#333333"><b>ご注意</b></font></td>
    </tr>
    <tr>
      <td bgcolor="#ffffff"><font size="-1" color="#333333">※天然木のため、模様や色あいがひとつひとつ異なります。 <BR>
        <br>
      ※水洗いはご遠慮くださいませ。濡れ布巾で軽く拭う程度でお願い致します。<br>
        <br>
        ※直射日光・高温は避けて保存してください。変型・変色の恐れがあります。<br>
        <br>
        ※タワシ・磨き粉・食器洗い洗浄機の使用は避けて下さい。<BR>
      <br>
      ※お客様のお使いのモニター設定、お部屋の照明等により実際の商品と色味が異なって見える場合がございます。</font></td>
    </tr>
</table>

<br><br>
<!--トレー説明--><table width="300" bgcolor="#cccccc" border="0" cellspacing="1" cellpadding="8">
    <tr>
      <td bgcolor="#f3f3f3"><font size="-1" color="#333333"><b>テーブルウェアイーストのトレー </b></font></td>
    </tr>
    <tr>
      <td bgcolor="#ffffff"><font size="-1" color="#333333">テーブルウェアイーストで販売中のトレーは木製のものを中心にお取り扱いしています。<br>
      <br>
      お盆として運ぶ用途以外にお膳や長角膳・ランチョンマットのように使えるものが人気です。<br>
      <br>
      サイズも小さいトレーから大きいトレーまであり、形は角型・丸型・アール型・手付きなど豊富に取り揃えております。<br>
      調味料用のトレーや、おしぼりトレー・どんぶり用トレーなど専門的用途のトレーも数多くございます。<br />
      <br>
      色は天然木のナチュラルなものから、濃いブラウン、和風にもモダンにもなるブラックなどからお選びいただけます。そして、スタッキングや滑り止めなど機能的なものもあり、業務用でトレイをお探しの方にもオススメです。<br>
      <br />
      テーブルウェアイーストのトレーはランチョンマットやお膳のように使われる方が多く、カフェ風の食卓の演出やおもてなしに使用したり、毎日の食卓のランクアップにお使いいただきたいアイテムです。<br>
      <br>
      和食器だけでなく北欧食器を始めとする洋食器とも違和感なく組み合わせできます。是非様々なテーブルコーディネートをお楽しみください。</font></td>
    </tr>
    </table><!--トレー説明終わり-->

